def count_primes(n):
    """Returns the number of prime numbers less than or equal to n."""
    if n < 2:
        return 0
    sieve = [True] * (n + 1)
    sieve[0], sieve[1] = False, False
    for i in range(2, int(n ** 0.5) + 1):
        if sieve[i]:
            for j in range(i*i, n+1, i):
                sieve[j] = False
    return sum(sieve)

# Calculating the values
values = [19, 93, 4, 1, 8]
prime_counts = [count_primes(val) for val in values]
prime_counts

